export class ShoppingCartService {
    constructor() {
        this.Items = new Set();
    }
    async addItem(item) {
        this.Items.push(item);
    }
    async removeItem(itemId) {
        let notRemoved = true;
        let count = 0;
        while (notRemoved) {
            if (this.Items[count].id === itemId) {
                notRemoved = false;
            }
        }
    }
    async getItems() {
        return Array.from(this.Items);
    }
}
